import Home from './pages/Home';

import Header from './components/Header';
import Footer from './components/Footer';

import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import './App.css';

function App() {
  return (
    <div>
      <Router>
        <Header />
        <Routes>
          <Route exact path='/' Component={Home} />
        </Routes>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
